import React from 'react'
import SIdebar from "./SIdebar";
import Topbar from "./Topbar";
export default function Devices() {
  return (
   <div className="Devices">
       <div className="d-flex">
      <SIdebar/>
      <div className="d-flex flex-direction-column">
      <Topbar/>
      <TeamCard/>
      </div>
      </div>
   </div>
  )
}
